import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import Axios from 'axios';
import { Link } from 'react-router-dom';

const EditWorkout = () => {
  const [exercise, setExercise] = useState("");
  const [sets, setSets] = useState(0);
  const [reps, setReps] = useState("");
  const [weight, setWeight] = useState("");
  const { tableName } = useParams();
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    Axios.get(`http://localhost:3001/tables/${tableName}`)
      .then((response) => {
        setTableData(response.data.map(exercise => ({ ...exercise, ticked: false })));
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, [tableData, tableName]);

  const deleteExercise = (id) => {
    Axios.delete(`http://localhost:3001/tables/${tableName}/delete/${id}`)
      .then(() => {
        setTableData(tableData.filter(exercise => exercise.id !== id));
      })
      .catch(error => console.error('Error deleting exercise:', error));
  };

  const addFullExercise = () => {
    Axios.post(`http://localhost:3001/create/${tableName}`, {
      exercise: exercise,
      sets: sets,
      reps: reps,
      weight: weight
    }).then(() => {
      setTableData([...tableData, {
        exercise: exercise,
        sets: sets,
        reps: reps,
        weight: weight
      }]);
      setExercise("");
      setSets(0);
      setReps("");
      setWeight("");
    }).catch(error => {
      console.error('Error adding exercise:', error);
    });
  };

  return (
    <div className="bg-black py-8">
      <div className="container mx-auto px-4">
        <h2 className="text-white mb-4">{tableName}</h2>
        <div className="overflow-x-auto">
          <table className="w-full">
            <thead className="text-white">
              <tr>
                <th className="px-2 py-2 sm:px-4 sm:py-2">Name</th>
                <th className="px-2 py-2 sm:px-4 sm:py-2">Sets</th>
                <th className="px-2 py-2 sm:px-4 sm:py-2">Reps</th>
                <th className="px-2 py-2 sm:px-4 sm:py-2">Weight</th>
                <th className="px-2 py-2 sm:px-4 sm:py-2">Action</th>
              </tr>
            </thead>
            <tbody>
              {tableData.map((exercise) => (
                <tr key={exercise.id}>
                  <td className="px-2 py-2 sm:px-4 sm:py-2">{exercise.Exercise}</td>
                  <td className="px-2 py-2 sm:px-4 sm:py-2">{exercise.Sets}</td>
                  <td className="px-2 py-2 sm:px-4 sm:py-2">{exercise.Reps}</td>
                  <td className="px-2 py-2 sm:px-4 sm:py-2">{exercise.Weight}</td>
                  <td className="px-2 py-2 sm:px-4 sm:py-2">
                    <button className="bg-red-500 text-white px-2 py-1 rounded-md" onClick={() => deleteExercise(exercise.id)}>
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
              <tr>
                <td className="px-2 py-2 sm:px-4 sm:py-2"><input type="text" value={exercise} onChange={(event) => setExercise(event.target.value)} /></td>
                <td className="px-2 py-2 sm:px-4 sm:py-2"><input type="number" value={sets} onChange={(event) => setSets(event.target.value)} /></td>
                <td className="px-2 py-2 sm:px-4 sm:py-2"><input type="text" value={reps} onChange={(event) => setReps(event.target.value)} /></td>
                <td className="px-2 py-2 sm:px-4 sm:py-2"><input type="text" value={weight} onChange={(event) => setWeight(event.target.value)} /></td>
                <td className="px-2 py-2 sm:px-4 sm:py-2">
                  <button className="bg-green-500 text-white px-2 py-1 rounded-md" onClick={addFullExercise}>
                    Add Exercise
                  </button>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
        <div className="mt-4 flex justify-center">
          <Link to="/" className="bg-green-500 text-white px-4 py-2 rounded-md hover:bg-green-600">Finish</Link>
        </div>
      </div>
    </div>
  );
};

export default EditWorkout;
